INSERT INTO `books_ratings` (`user_id`, `isbn`, `rating`, `comment`) VALUES
(1, '0002005018', 8, 'frgbvear evfae ver'),
(1, '0020437501', 5, '"Sed ut perspiciatis unde omnis iste natus error sit voluptatem accusantium doloremque laudantium, totam rem aperiam, eaque ipsa quae ab illo inventore veritatis et quasi architecto beatae vitae dicta sunt explicabo. Nemo enim ipsam voluptatem quia voluptas sit aspernatur aut odit aut fugit, sed quia consequuntur magni dolores eos qui ratione voluptatem sequi nesciunt. Neque porro quisquam est, qui dolorem ipsum quia dolor sit amet, consectetur, adipisci velit, sed quia non numquam eius modi tempora incidunt ut labore et dolore magnam aliquam quaerat voluptatem. Ut enim ad minima veniam, quis nostrum exercitationem ullam corporis suscipit laboriosam, nisi ut aliquid ex ea commodi consequatur? Quis autem vel eum iure reprehenderit qui in ea voluptate velit esse quam nihil molestiae consequatur, vel illum qui dolorem eum fugiat quo voluptas nulla pariatur?"'),
(1, '0029087104', 9, 'hhhh'),
(1, '0060013117', 6, 'affgwegfwegergare'),
(1, '0060563079', 6, 'sdfgdg'),
(1, '0060930365', 4, 'bad book'),
(1, '044023767X', 8, 'Great!'),
(16, '0020437501', 4, 'Most text editors like MS Word or Lotus Notes generate random lorem text when needed, either as pre-installed module or plug-in to be added. Word selection or sequence don''t necessarily match the original, which is intended to add variety. Presentation software like Keynote or Pages use it as a samples for screenplay layout. Content management software as Joomla!, Drupal, Mambo, PHP-Nuke, WordPress, or Movable Type offer Lorem Ipsum plug-ins with the same functionality.'),
(17, '0020437501', 10, 'In a professional context it often happens that private or corporate clients corder a publication to be made and presented with the actual content still not being ready. Think of a news blog that''s filled with content hourly on the day of going live. However, reviewers tend to be distracted by comprehensible content, say, a random text copied from a newspaper or the internet. The are likely to focus on the text, disregarding the layout and its elements. Besides, random text risks to be unintendedly humorous or offensive, an unacceptable risk in corporate environments. Lorem ipsum and its many variants have been employed since the early 1960ies, and quite likely since the sixteenth century.'),
(405, '0060094850', 2, 'We are only three decades into one of the most important revolutions the world has ever seen. In design development terms, that is a mere blink.'),
(406, '0060094850', 3, 'Simplicity should be found in the execution, not in the meaning.'),
(407, '0060094850', 5, 'Great stories happen to people who can tell them.  '),
(408, '0030615321', 6, 'Don&#8217;t try to be original try to be good.'),
(408, '0060094850', 3, 'Sometimes I&#8217;m amazed that I spend my days creating magic and fantasy and that people buy it. It&#8217;s like connecting with the inner child in me; I&#8217;m just having a great time, and I&#8217;m chuckling to myself that this is really happenin'),
(409, '0020518609', 6, 'No matter how many times your amazing, absolutely brilliant work is rejected by the client, for whatever dopey, arbitrary reason, there is often another amazing, absolutely brilliant solution possible.\n\n\nSometimes it’s even better.'),
(409, '0030615321', 6, 'An inexperienced observer sees everything in a picture; the experienced one sees even the things that are missing.  '),
(409, '0060094850', 4, 'We adore chaos because we love to produce order.'),
(410, '0020518609', 8, 'Without good design it is easy to miss the point.'),
(410, '0030615321', 7, 'We have a strategic plan. It&#8217;s called doing things.'),
(411, '0020518609', 9, 'Just because it&#8217;s simple doesn&#8217;t mean it makes sense.'),
(411, '0030615321', 5, 'Design is where science and art break even.  '),
(412, '0020518609', 10, 'Traditional marketing is often seeing is getting people to do things but I think web marketing is about helping people do things. '),
(412, '0030615321', 10, 'Let the design team be the design experts. Your job is to be the business expert. Ask them how their design solutions meet your business goals. If you trust your design team, and they can explain how their recommendations map to those goals'),
(413, '0020518609', 1, 'I love designing, it is something which permeates my whole living, whether it is simply choosing the colour of my clothes in the morning or organising my household. Design to me is akin to beauty, an externalisation of my inner process regarding beauty'),
(420, '0030096189', 6, 'My adventure has all been in my mind. The great adventure has been thinking. I love to think about things. I think that the lack of drama in my life has produced a platform for me to be fundamentally adventurous in my thinking.'),
(421, '0030096189', 5, 'When we feel less secure, with less control over our daily lives, we reach out to brands to connect with a time when things seemed better.'),
(422, '0030096189', 1, 'What is the most treasured and well-used piece of equipment in your studio?&#8221;</em> My head.'),
(423, '0030096189', 2, 'I can never stand still. I must explore and experiment. I am never satisfied with my work. I resent the limitations of my own imagination.'),
(423, '006015781X', 9, 'However beautiful the strategy, you should occasionally look at the results.'),
(424, '0030096189', 8, 'IDEA BY SELF IS COLD. JUST SIT THERE. DO NOTHING.</p>\n<p>IF WANT DO SOMETHING, NEED FIRE.'),
(424, '006015781X', 8, 'We use the letters of our alphabet every day with the utmost ease and unconcern, taking them for granted as the air we breathe. We do not realize that each of these letters is at our service today only as the result of a long and laboriously slow proce'),
(425, '006015781X', 6, 'Marketing without design is lifeless, and design without marketing is mute.'),
(426, '006015781X', 7, 'A designer is a planner with an aesthetic sense.'),
(427, '006015781X', 8, 'Mistakes are the portals of discovery.'),
(430, '006017143X', 9, 'Design is a response to a specific problem. You are given a problem to solve, and then you let the problem itself tell you what your solution is.'),
(431, '006017143X', 4, 'Preparation gives birth to self-confidence.'),
(432, '006017143X', 7, 'IDEA BY SELF IS COLD. JUST SIT THERE. DO NOTHING.IF WANT DO SOMETHING, NEED FIRE.'),
(433, '0029087104', 2, 'The ultimate inspiration is the deadline.'),
(433, '006017143X', 3, 'Find something you&#8217;re passionate about and keep tremendously interested in it.'),
(434, '0029087104', 8, 'Passion, dedication, and silly lists of what designers need are what designers need.'),
(435, '0029087104', 8, 'Almost everything &#8211; all external expectations, all pride, all fear of embarrassment or failure &#8211; these things just fall away in the face of death, leaving only what is truly important.'),
(435, '0060006048', 8, 'A designer knows he has achieved perfection not when there is nothing left to add, but when there is nothing left to take away.'),
(436, '0029087104', 3, 'The typeface doesn&#8217;t really matter, as long as the text is good.'),
(436, '0060006048', 9, 'At this point in experience design&#8217;s evolution, satisfaction ought to be the norm, and delight out to be the goal.'),
(437, '0029087104', 1, 'I don&#8217;t think that design needs theory, but I think designers need theory.'),
(437, '0060006048', 3, 'If you look at any designer you admire, whose work inspires you, and whose approach somehow resonates with you, I promise youâ€™ll find a person who does not think of what they do as just their job.'),
(438, '0060006048', 10, 'When I complained about being paid fifty dollars for an article that had taken me a week to write, he [Kurt] said I should take into account what it would have cost me to take out a two-page ad announcing that I could write.'),
(438, '0060083298', 1, 'The moment clients realize that revisions are not an all-you-can-eat buffet, suddenly they realize they are not hungry. '),
(439, '0060006048', 3, 'Helvetica is like a really good friend. You go off and hang with the other fonts (the artsy, grungy, trendy, thin, fat, tall, scripty types) and even use them a little, but helvetica is always there. A nice stable friend.  '),
(439, '0060083298', 2, 'I have found the best people to work with are gay men. They never have to &#8216;run it past their wives.'),
(440, '0060083298', 7, 'You can use an eraser on the drafting table or a sledge hammer on the construction site.'),
(441, '0060083298', 3, 'A healthy creative process should be able to give a coherent rationale to a client as to why you designed what you designed.'),
(442, '0060083298', 5, 'try to absorb what is useful, discard what is useless, and add what is essentially your own.'),
(469, '8445071769', 5, 'We live in a society where everybody feels guilty. We want to do good, but we don’t want to get out of the house. A brand can help us feel good if you buy this yogurt.');
